import { Radar } from "react-chartjs-2"

const RadarChart = ({ chartData }) => {
    const DataforRadarChart = [
        {
            title: "Movement",
            balanceScore: 150
          },
          {
            title: "Sleep",
            balanceScore: 50
          }, 
          {
            title: "Food",
            balanceScore: 125
          },
          {
            title: "Occupation",
            balanceScore: 300
          },
          {
            title: "Activity",
            balanceScore: 100
          },
    ]







    return (
        <div>
            <h2 style={{ textAlign: "center" }}>Radar Chart</h2>
            <Radar
                data={chartData}
                options={{
                    plugins: {
                        scales: {
                            y: {
                                ticks: {
                                    display: false
                                }
                            }
                        }
                    }
                }}
            />
        </div>
    )
}

export default RadarChart
